		"text": "텍스트는 감정적으로 받아드릴 수 있다. 그리고 emoji나 이모티콘이 텍스트의 부족한 부분을 채워줄 수 있다고 생각한다. 그런데 나는 잘 사용하지 않기 때문에 텍스트는 텍스트 그대로 쓴다. 기분이 나쁘면 ~해서 기분이 나쁘다고 쓰는 것이다.",
