		"id_str": "1002928364561133568",
		"text": "\"2017년까지 정릉동에 1~6호점, 보문동에 7호점을 공급했고, 올해는 장위동에 8·9호점을 마련했다. 10월 보문동에 10호점이 열리면 모두 144가구가 살게 된다. 성북구는 이 사업으로 지방자치 정책 대상 최우수상을 받았다.\"",
